import{_ as e,c as o,ah as a,o as i}from"./chunks/framework.BWXOFiC5.js";const s="/assets/Windows11CompliantTask.BxAwpEH-.png",l="/assets/TaskFail.Nij91s94.png",m=JSON.parse('{"title":"Upgrade Windows 10 to Windows 11","description":"","frontmatter":{},"headers":[],"relativePath":"Documentation/HowToGuides/upgrading-windows-10-to-windows-11.md","filePath":"Documentation/HowToGuides/upgrading-windows-10-to-windows-11.md"}'),n={name:"Documentation/HowToGuides/upgrading-windows-10-to-windows-11.md"};function d(r,t,u,h,p,g){return i(),o("div",null,t[0]||(t[0]=[a('<h1 id="upgrade-windows-10-to-windows-11" tabindex="-1">Upgrade Windows 10 to Windows 11 <a class="header-anchor" href="#upgrade-windows-10-to-windows-11" aria-label="Permalink to &quot;Upgrade Windows 10 to Windows 11&quot;">​</a></h1><h2 id="overview" tabindex="-1">Overview <a class="header-anchor" href="#overview" aria-label="Permalink to &quot;Overview&quot;">​</a></h2><p>With the upcoming retirement of Windows 10, we have published this document to give you guidance on upgrading Windows 10 to Windows 11 utilizing ImmyBot. At a high level this document will inform you on the proper deployments to utilize to upgrade Windows 10 to Windows 11 as well give you some best practices that you can integrate into your deployment projects.</p><h2 id="prerequisites" tabindex="-1">Prerequisites <a class="header-anchor" href="#prerequisites" aria-label="Permalink to &quot;Prerequisites&quot;">​</a></h2><ul><li>An active ImmyBot subscription</li><li>Advanced knowledge on creating and managing Deployments using Tags.</li></ul><h2 id="best-practices" tabindex="-1">Best Practices <a class="header-anchor" href="#best-practices" aria-label="Permalink to &quot;Best Practices&quot;">​</a></h2><ul><li>Utilize Cross Tenant Deployments to prevent repeating processes where possible.</li></ul><h2 id="computer-targeting-guidance" tabindex="-1">Computer Targeting Guidance <a class="header-anchor" href="#computer-targeting-guidance" aria-label="Permalink to &quot;Computer Targeting Guidance&quot;">​</a></h2><div class="warning custom-block"><p class="custom-block-title">About running this task in Audit mode</p><p>Audit mode will only run the test action against the machine. Part of this script is to verify if the computer is already on Windows 11, and to return a true to ImmyBot if it is. With that said, if a computer is Windows 10 and passes all of the tests it will also return a true to ImmyBot.</p><p>All of this to say if you run this task against a Windows 11 machine in Audit mode with the expectation that you need to update it to Windows 11, your results will be skewed in the audit.</p><p>Only run this task in Audit mode against Windows 10 machines. You can utilize the Windows 10 Filter Script if you don&#39;t want to utilize Tags.</p></div><p>We recommend using the <strong>Windows 11 Upgrade</strong> Task in Audit mode against the computers you&#39;re wanting to update. This is to ensure ahead of time that the computers are compatible with the update process.</p><h2 id="process" tabindex="-1">Process <a class="header-anchor" href="#process" aria-label="Permalink to &quot;Process&quot;">​</a></h2><div class="warning custom-block"><p class="custom-block-title">If you&#39;re using <strong>Install Windows Updates (Beta)</strong> in your deployments already, we recommend creating a Single Tenant Deployment to ignore this task so that you have a controlled deployment otherwise you will run into issue where the Windows 11 upgrade is pushed outside of your deployment window.</p></div><p>You need to either create a deployment with a Tag or create a deployment with a filter script. You do not need to do both, this is just meant to give you options.</p><h4 id="set-up-your-tag" tabindex="-1">Set up your Tag <a class="header-anchor" href="#set-up-your-tag" aria-label="Permalink to &quot;Set up your Tag&quot;">​</a></h4><ol><li>Create a tag with the name <strong>Windows 11 Upgrade</strong></li></ol><h4 id="set-up-your-deployment-with-a-tag" tabindex="-1">Set up your Deployment with a Tag <a class="header-anchor" href="#set-up-your-deployment-with-a-tag" aria-label="Permalink to &quot;Set up your Deployment with a Tag&quot;">​</a></h4><ol><li>Create a deployment with the task <strong>Windows 10 to Windows 11 Upgrade - Beta</strong><ul><li>Task Mode: Enforced</li><li>Parameters: Leave default</li><li>Target Enforcement: Adhoc</li><li>Target Scope: Cross Tenant <ul><li>Target Type: Tag <ul><li>Tag Name: <strong>Windows 11 Upgrade</strong></li></ul></li><li>Target Filter: Workstations and Portable Devices</li></ul></li></ul></li><li>Tag all target computers with the tag <strong>Windows 11 Upgrade</strong></li></ol><hr><h4 id="set-up-your-deployment-with-a-filter-script-and-single-tenant-deployment" tabindex="-1">Set up your Deployment with a Filter Script and Single Tenant Deployment <a class="header-anchor" href="#set-up-your-deployment-with-a-filter-script-and-single-tenant-deployment" aria-label="Permalink to &quot;Set up your Deployment with a Filter Script and Single Tenant Deployment&quot;">​</a></h4><ol><li>Create a deployment with the task <strong>Windows 10 to Windows 11 Upgrade - Beta</strong><ul><li>Task Mode: Enforced</li><li>Parameters: Leave default</li><li>Target Enforcement: Adhoc</li><li>Target Scope: Single Tenant <ul><li>Tenant: Select the Tenant you need to push this to</li><li>Target Type: Filter Script <ul><li>Tag Name: <strong>Windows 10 (Global)</strong></li></ul></li><li>Target Filter: Workstations and Portable Devices</li></ul></li></ul></li></ol><h2 id="before-day-of-deployment" tabindex="-1">Before Day of Deployment <a class="header-anchor" href="#before-day-of-deployment" aria-label="Permalink to &quot;Before Day of Deployment&quot;">​</a></h2><p>Ensure computers don&#39;t have any pending updates. You can utilize ImmyBot&#39;s Global Task <strong>Install Windows Updates</strong>.</p><h2 id="deployment-time" tabindex="-1">Deployment Time <a class="header-anchor" href="#deployment-time" aria-label="Permalink to &quot;Deployment Time&quot;">​</a></h2><div class="info custom-block"><p class="custom-block-title">Schedule this</p><p>If you&#39;re an ImmyBot Standard or ImmyBot Forever customer, you can schedule this.</p></div><p>Schedule or manually run maintenance sessions for this task <strong>with Forced Reboots</strong></p><h3 id="after-successful-upgrade" tabindex="-1">After Successful Upgrade <a class="header-anchor" href="#after-successful-upgrade" aria-label="Permalink to &quot;After Successful Upgrade&quot;">​</a></h3><ol><li>Remove the tag <strong>Windows 11 Upgrade</strong> from computers</li><li>Remove any deployments you created to stop the Windows Update Beta from running.</li></ol><h2 id="advice" tabindex="-1">Advice <a class="header-anchor" href="#advice" aria-label="Permalink to &quot;Advice&quot;">​</a></h2><ul><li>You don&#39;t <strong>NEED</strong> to use tags for this. If you want you can use single tenant deployments for all of this, we recommend tags as a way to manage this en masse without having to do the same thing over and over again.</li></ul><h2 id="troubleshooting" tabindex="-1">Troubleshooting <a class="header-anchor" href="#troubleshooting" aria-label="Permalink to &quot;Troubleshooting&quot;">​</a></h2><p>Why does the task fail in the test phase?</p><ul><li>This can be for a number of reasons, but the answer is in the results of the test phase. This task checks for 4 things in the test phase: <ol><li>Is this computer already Windows 11? If yes, pass and do nothing else, if no, move on to step 2. <img src="'+s+'" alt="alt text"></li><li>Disk Space - Is the free space more then 25 GB? If not fail, if is it, move one to step 3</li><li>Disk Health - Are there any predictive or SMART failures on the disk? If yes, fail, if not, move on to step 4</li><li>Windows 11 readiness - Does the computer pass the Windows 11 readiness script from Microsoft? If no, fail, if yes move on to the execution stage. <img src="'+l+'" alt="alt text"></li></ol></li></ul><h2 id="how-we-tested" tabindex="-1">How We Tested <a class="header-anchor" href="#how-we-tested" aria-label="Permalink to &quot;How We Tested&quot;">​</a></h2><p>In our testing, it took on average about one hour and 54 minutes for the upgrade process to complete.</p><p>These are all fresh Windows installs. If the computer was domain joined, it had the default domain level GPO applied to it, and setting to ensure that the GPO did not block Windows 11 upgrades. See <a href="https://learn.microsoft.com/en-us/windows/deployment/update/waas-wufb-group-policy" target="_blank" rel="noreferrer">Microsoft&#39;s Guidance</a> for more information.</p><p>Specs: 8 3.7 GHz cores, 8 GB RAM, 100 GB SSD</p><table tabindex="0"><thead><tr><th style="text-align:left;">Windows OS Version</th><th style="text-align:left;">Domain Joined?</th><th style="text-align:left;">Time to Completion</th><th style="text-align:left;">Successful?</th><th style="text-align:left;">Issues?</th><th style="text-align:left;">Notes</th></tr></thead><tbody><tr><td style="text-align:left;">Windows 10 22H2</td><td style="text-align:left;">No</td><td style="text-align:left;">1 hr 20 min</td><td style="text-align:left;">Yes</td><td style="text-align:left;">None</td><td style="text-align:left;">Wifi, speed: 700 Mbps download</td></tr><tr><td style="text-align:left;">Windows 10 22H2</td><td style="text-align:left;">No</td><td style="text-align:left;">2 hr 30 min</td><td style="text-align:left;">Yes</td><td style="text-align:left;">None</td><td style="text-align:left;">Wifi, speed: 7.5 Mbps download</td></tr><tr><td style="text-align:left;">Windows 10 22H2</td><td style="text-align:left;">Yes</td><td style="text-align:left;">1 hr 30 min</td><td style="text-align:left;">Yes</td><td style="text-align:left;">None</td><td style="text-align:left;">Wifi, speed: 700 Mbps download</td></tr><tr><td style="text-align:left;">Windows 10 21H2</td><td style="text-align:left;">Yes</td><td style="text-align:left;">2 hr 0 min</td><td style="text-align:left;">Yes</td><td style="text-align:left;">Had 2 CU&#39;s that needed to get installed first</td><td style="text-align:left;">Wifi, speed: 700 Mbps download</td></tr><tr><td style="text-align:left;">Windows 10 21H2</td><td style="text-align:left;">No</td><td style="text-align:left;">2 hr 0 min</td><td style="text-align:left;">Yes</td><td style="text-align:left;">Had 2 CU&#39;s that needed to get installed first</td><td style="text-align:left;">Wifi, speed: 700 Mbps download</td></tr><tr><td style="text-align:left;">Windows 10 21H1</td><td style="text-align:left;">No</td><td style="text-align:left;">2 hr 0 min</td><td style="text-align:left;">Yes</td><td style="text-align:left;">Had 2 CU&#39;s that needed to get installed first</td><td style="text-align:left;">Wifi, speed: 700 Mbps download</td></tr><tr><td style="text-align:left;">Windows 10 21H1</td><td style="text-align:left;">Yes</td><td style="text-align:left;">2 hr 0 min</td><td style="text-align:left;">Yes</td><td style="text-align:left;">Had 2 CU&#39;s that needed to get installed first</td><td style="text-align:left;">Wifi, speed: 700 Mbps download</td></tr></tbody></table><p><br><br><br></p><div class="note custom-block github-alert"><p class="custom-block-title">Document information</p><p>Author: Mark Gomez <br> Date Published: 2025/09/15 <br> Date Revised: N/A <br> Version Number: 1.0</p></div>',39)]))}const f=e(n,[["render",d]]);export{m as __pageData,f as default};
